const News = (props) => {
    return ( 
        <div className="restNews">
            <div className="imageWrapper">
                <img src="" alt="" />
            </div>
            <div className="text">
                <h2 className="title">mans</h2>
                <p className="paragraph">hello</p>
            </div>
        </div>
     );
}
 
export default News;
